object.script:
function onTick() -- Read the touchscreen data from the script's composite input inputX = input.getNumber(3) inputY = input.getNumber(4) isPressed = input.getBool(1) M = input.getNumber(10) L = input.getBool(6)
-- Check if the player is pressing the rectangle at (10, 10) with width and height of 20px
isPressingRectangle1 = isPressed and isPointInRectangle(inputX, inputY, 25, 9, 6, 6) isPressingRectangle2 = isPressed and isPointInRectangle(inputX, inputY, 25, 17, 6, 6) isPressingRectangle3 = isPressed and isPointInRectangle(inputX, inputY, 25, h-7, 6, 6)
-- Set the composite output, on/off channel 1 output.setBool(1, isPressingRectangle1) output.setBool(2, isPressingRectangle2) output.setBool(3, isPressingRectangle3)
end
-- Returns true if the point (x, y) is inside the rectangle at (rectX, rectY) with width rectW and height rectH function isPointInRectangle(x, y, rectX, rectY, rectW, rectH) return x > rectX and y > rectY and x < rectX+rectW and y < rectY+rectH end
function onDraw() w=screen.getWidth() h=screen.getHeight()
screen.setColor(200, 200, 200, 200)
screen.drawTextBox(15, 1, 16, 7,string.format("%.0fm", M), 1, 0)
if isPressingRectangle1 then screen.setColor(200, 200, 200) else screen.setColor(200, 200, 200, 200) end screen.drawRect(25, 9, 6, 6) --(+) screen.drawTextBox(26, 9, 7, 7, "+", 0, 0)
if isPressingRectangle2 then screen.setColor(200, 200, 200) else screen.setColor(200, 200, 200, 200) end screen.drawRect(25, 17, 6, 6) --(-) screen.drawTextBox(26, 17, 7, 7, "-", 0, 0)
if L then screen.setColor(200, 200, 200) screen.drawRectF(25, h-7, 7, 7) --Light screen.setColor(0, 0, 0) screen.drawLine(27, h-5, 27, h-3) screen.drawLine(27, h-3, 30, h-3)
else screen.setColor(200, 200, 200, 200) screen.drawRect(25, h-7, 6, 6) --Light screen.drawLine(27, h-5, 27, h-3) screen.drawLine(27, h-3, 30, h-3) end
end
